import axios from 'axios';

const login = async (email, password) => {
    try {
        const response = await axios.post('http://localhost:8000/api/login', {
            email,
            password
        });
        console.log('---------')
        console.log(response)
        return response.data;
    } catch (error) {
        return error;
    }
};

export default login;
